import "./main.css";

const SideMenus = () => {
  return (
    <>
      <nav className="sideMenu">
      
        <p>ようこそ {}さん</p>
        <p>
          <Link to="newTitle">新規スレッドを書く</Link>
        </p>
        <p>
          <Link to="login">ログイン</Link>
        </p>
        <p>
          <Link to="signup">ログイン</Link>
        </p>
        <p>掲示板検索</p>
        
    </nav>
    </>
  );
}

